import React from "react";
import "./styles.scss";
import logo from "../../images/ME-LOGO.png";

const NavigationBar = () => {
  return (
    <header >
      <div className="nav">
      <div>
        <a href="#top">
          <img src={logo} alt="maisiembleton-logo" className="nav-logo" />
        </a>
      </div>
      <div className="nav-links">
        <a href="#about">About</a>
        <a href="#work">Work</a>
        {/* TODO: add cta button */}
        {/* <Button /> */}
      </div>
      \</div>
    </header>
  );
};

export default NavigationBar;
